body:
this change should not break anything.

toJSON will not generate a string - instead you get an object (or `any` because it's less restrictive)

```
const obj =  myNetwork.toJSON();
fs.writeFile('train.json', JSON.stringify(obj));

...
fs.readFile('train.json', 'utf-8', (err, data) => {
   const myNetwork2 = Network.fromJSON(<any>JSON.parse(data));
});
```
